import React from 'react'

function FeasibilityInfo() {

    function getSelectInput(question, answer) {

        return <div className="form-input">
            <select class="form-select" aria-label="Default select example">
                <option selected>{question}</option>
                {answer.map((option) => <option value="1">{option}</option>)}
            </select>
        </div>
    }

    function getCheckInput(question) {

        return <div className="form-check form-input">
            <input className="form-check-input" type="checkbox" value="" />
            <label className='check-label'>
                {question}
            </label>
        </div>

    }


    return (
        <div style={{textAlign: "center"}}>
            <header className="App-header">
                معلومات المشروع
            </header>

            <form className='infoForm col-sm-8'>
                <fieldset>
                    <div className="mb-3 form-input">
                        <input type="text" className="form-control" placeholder="الاسم" />
                    </div>
                    
                    {getSelectInput("حدد القطاع", ["خيار 1", "خيار 2"])}
                    {getSelectInput("حدد نشاط المشروع", ["خيار 1", "خيار 2"])}


                </fieldset>
            </form>

        </div>
    )
}

export default FeasibilityInfo
